#include <iostream>

namespace geom{
struct Point{
    int x = 0; 
    int y = 0;
};

std::ostream& operator<<(std::ostream& out, Point p) {
    return out << '{' << p.x << ',' << p.y << '}';
}

void Print(Point p) {
    std::cout << p << std::endl;
}
} // namespace geom

int main() {
    geom::Point p{3, 4};
    // –í—ã–∑—ã–≤–∞–µ–º —Ñ—É–Ω–∫—Ü–∏—é geom::Print, —É–∫–∞–∑—ã–≤–∞—è –µ—ë –ø–æ–ª–Ω–æ–µ –∏–º—è
    geom::Print(p);
    
    // –ö–æ–º–ø–∏–ª—è—Ç–æ—Ä –Ω–∞—à—ë–ª —Ñ—É–Ω–∫—Ü–∏—é Print, –Ω–µ—Å–º–æ—Ç—Ä—è –Ω–∞ —Ç–æ, —á—Ç–æ –º—ã –Ω–µ —É–∫–∞–∑–∞–ª–∏ –µ—ë –ø–æ–ª–Ω–æ–µ –∏–º—è,
    // –¢–∞–∫ –∫–∞–∫ –ø–∞—Ä–∞–º–µ—Ç—Ä —Ñ—É–Ω–∫—Ü–∏–∏ p –∏–º–µ–µ—Ç —Ç–∏–ø geom::Point,
    // –∫–æ–º–ø–∏–ª—è—Ç–æ—Ä –∏—â–µ—Ç —Ñ—É–Ω–∫—Ü–∏—é Print –µ—â—ë –∏ –≤ –ø—Ä–æ—Å—Ç—Ä–∞–Ω—Å—Ç–≤–µ –∏–º—ë–Ω geom.
    Print(p);

    // –ö–æ–º–ø–∏–ª—è—Ç–æ—Ä –∏—â–µ—Ç –ø–æ–¥—Ö–æ–¥—è—â—É—é –æ–ø–µ—Ä–∞—Ü–∏—é << –≤ –ø—Ä–æ—Å—Ç—Ä–∞–Ω—Å—Ç–≤–µ –∏–º—ë–Ω std –∏ –≤ –ø—Ä–æ—Å—Ç—Ä–∞–Ω—Å—Ç–≤–µ –∏–º—ë–Ω geom
    // –∏ –Ω–∞—Ö–æ–¥–∏—Ç –µ–≥–æ –≤ geom. –ë–ª–∞–≥–æ–¥–∞—Ä—è ADL –º—ã –≤—ã–≤–æ–¥–∏–º –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å—Å–∫–∏–µ —Ç–∏–ø—ã —Ç–∞–∫:
    std::cout << p;
    // –∞ –Ω–µ —Ç–∞–∫:
    geom::operator<<(std::cout, p);
}
